INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (7, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 106001, 7001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0, 0.0, 0.0, 1, "キャル", 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (7, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 105901, 7002, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0, 0.0, 0.0, 1, "コッコロ", 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (7, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 105801, 7003, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0, 0.0, 0.0, 1, "ペコリーヌ", 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 106001, 10001, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0, 0.0, 0.0, 1, "キャル", 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 105901, 10002, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0, 0.0, 0.0, 1, "コッコロ", 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (10, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 105801, 10003, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0, 0.0, 0.0, 1, "ペコリーヌ", 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (12, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -416.5, 105801, 12001, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0, 0.0, 0.0, 1, "ペコリーヌ", 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (13, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 106001, 13001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0, 0.0, 0.0, 1, "キャル", 1);
