INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (13, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 105801, 13003, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0, 0.0, 0.0, 1, "ペコリーヌ", 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (14, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 106001, 14001, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0, 0.0, 0.0, 1, "キャル", 1);
