INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (14, 0, 1, "2030/12/17 14:59:59", "2015/12/17 15:00:00", -363.0, 105801, 14003, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0, 0.0, 0.0, 1, "ペコリーヌ", 1);
