INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 109001, 24001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 0, 4.08, 8.0, 2, "エリコ（バレンタイン）", 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 109001, 24002, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 0, 5.0, 8.0, 2, "エリコ（バレンタイン）", 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 109001, 24003, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 0, 10.11, 8.0, 2, "エリコ（バレンタイン）", 3);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 109001, 24004, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 0, 4.0, 8.0, 2, "エリコ（バレンタイン）", 4);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 109001, 24005, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 0, 6.0, 8.0, 2, "エリコ（バレンタイン）", 5);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 109002, 24006, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0, 0.0, 0.0, 1, "エリコ（バレンタイン）", 6);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 109002, 24007, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0, 0.0, 0.0, 1, "エリコ（バレンタイン）", 7);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 109002, 24008, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0, 0.0, 0.0, 1, "エリコ（バレンタイン）", 8);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 109002, 24009, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0, 0.0, 0.0, 1, "エリコ（バレンタイン）", 9);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 109002, 24010, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0, 0.0, 0.0, 1, "エリコ（バレンタイン）", 10);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 109101, 24011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 0, 2.12, 8.0, 2, "シズル（バレンタイン）", 1);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 5, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 109101, 24012, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 0, 4.19, 8.0, 2, "シズル（バレンタイン）", 2);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 2, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 109101, 24013, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 0, 2.3, 8.0, 4, "シズル（バレンタイン）", 3);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 109102, 24014, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0, 0.0, 0.0, 1, "シズル（バレンタイン）", 4);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 5, "2030/12/17 14:59:59", "2019/01/31 12:00:00", -385.0, 109101, 24015, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 0, 5.23, 8.0, 2, "シズル（バレンタイン）", 5);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (24, 10011, 1, "2030/12/17 14:59:59", "2019/01/31 12:00:00", 0.0, 109102, 24016, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0, 0.0, 0.0, 1, "シズル（バレンタイン）", 6);
